  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"typescript-api"}}>{`TypeScript API`}</MDXTag>
<MDXTag name="p" components={components}>{`Please visit github api readme `}<MDXTag name="a" components={components} parentName="p" props={{"href":"https://github.com/nearprotocol/near-runtime-ts/blob/master/apidoc/modules/_near_.md"}}>{`https://github.com/nearprotocol/near-runtime-ts/blob/master/apidoc/modules/_near_.md`}</MDXTag>{` while our neardoc page for the TypeScript API is under construction.`}</MDXTag>
           </MDXTag>
  }
}
